import osimport sysimport sysimport numpy as npimport pandas as pdimport unittestsys.path.append(os.path.join(os.path.dirname(__file__), os.path.pardir))#from src.helper.data_helper import create_parquet_without_rows_with_no_residentsclass TestParquetWithoutRowsWithNoResidents(unittest.TestCase):    def setUp(self):        self.__create_parquet_without_rows_with_no_residents = TestParquetWithoutRowsWithNoResidents()    def tearDown(self):        del self.__create_parquet_without_rows_with_no_residents    def test_no_file(self):        result = 0        df = pd.read_parquet(            "./datasets/generated/100m_cleared.parquet")        for row in df['Einwohner']:            if row == -1:                result += 1        self.assertEqual(result, 0)if __name__ == '__main__':    unittest.main()